import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";

function NewsDetailsComponent({ newsData }) {
  return (
    <div className="row row-cols-1 row-cols-md-2 g-4">
      {newsData.slice(0, 10).map((news) => (
        <div className="col-md-6" key={news.url}>
          <div className="card">
            <div className="row g-0 align-items-center">
              <div className="col-md-4">
                <img src={news.urlToImage} alt="News" className="img-fluid img-thumbnail rounded-start" 
                                style={{ height: "80%", width:"60%", objectFit: "contain" }}
                                />
              </div>
              <div className="col-md-8">
                <div className="card-body">
                  <h6 className="card-title">
                    {news.title}
                    </h6>
                  {/* Additional card content */}
                </div>
              </div>
            </div>
          </div>
        </div>
      ))}
    </div>
  );
}

export default NewsDetailsComponent;
